(24, 150, 'La Caja Torácica', 'la-caja-toracica', '<p> </p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/caja_toraxicajpg.jpg\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">El tórax es la parte del cuerpo humano que está entre la base del cuello y el diafragma. Contiene a los pulmones, el corazón, voluminosos vasos sanguíneos, linfáticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simpática de donde salen las ramas esplácnicas, las venas ácigos (mayor y menor), el esófago y el conducto torácico. Su división fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.</p>\r\n<p style=\"text-align: justify;\">Tiene forma de cono truncado o pirámide y su pared está formada por los arcos costales (costillas) y los músculos intercostales, que se unen anteriormente al hueso esternón por medio de cartílagos y posteriormente a la columna vertebral. La función de esta formación osteocartilaginosa, es la de proteger los órganos internos de los traumatismos mecánicos, que de otra manera podrían lesionarlos.</p>\r\n<p style=\"text-align: justify;\">La caja torácica tiene la particularidad de ser expansible, permitiendo la inspiración (inhalación). Además, su último par de costillas son flotantes, ya que están unidas solo a las vértebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.</p>\r\n<p style=\"text-align: justify;\">El nombre deriva del Latín thorax, y este del griego -θώραξ-; que significa propiamente coraza.</p>', '', -2, 19, '2021-02-08 07:44:57', 380, '', '2021-02-08 07:44:57', 0, 0, '0000-00-00 00:00:00', '2021-02-08 07:44:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"helix_ultimate_image\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\"}', 1, 1, '', '', 1, 4, '{}', 0, '*', '', ''),
