(29, 162, 'Caja Toracica', 'caja-toracica', '<h3>Caja Torácica</h3>\r\n<p><img src=\"images/imagenes/cajatorasica.jpeg\" alt=\"\" /></p>\r\n<p>El tórax es la parte del cuerpo humano que está entre la base del cuello y el diafragma. Contiene a los pulmones, el corazón, voluminosos vasos sanguíneos, linfáticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simpática de donde salen las ramas esplácnicas, las venas ácigos (mayor y menor), el esófago y el conducto torácico. Su división fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.</p>\r\n<p>Tiene forma de cono truncado o pirámide y su pared está formada por los arcos costales (costillas) y los músculos intercostales, que se unen anteriormente al hueso esternón por medio de cartílagos y posteriormente a la columna vertebral. La función de esta formación osteocartilaginosa, es la de proteger los órganos internos de los traumatismos mecánicos, que de otra manera podrían lesionarlos.</p>\r\n<p>La caja torácica tiene la particularidad de ser expansible, permitiendo la inspiración (inhalación). Además, su último par de costillas son flotantes, ya que están unidas solo a las vértebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.</p>\r\n<p>El nombre deriva del Latín thorax, y este del griego -θώραξ-; que significa propiamente coraza.</p>', '', -2, 2, '2021-02-08 09:44:46', 380, '', '2021-02-08 09:44:46', 0, 0, '0000-00-00 00:00:00', '2021-02-08 09:44:46', '0000-00-00 00:00:00', '{}', '{}', '{\"helix_ultimate_image\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\"}', 1, 0, '', '', 1, 0, '{}', 0, '*', '', '');
