(94, 88, 'Carga de Documentos', '', '', 1, 'content-bottom', 0, '0000-00-00 00:00:00', '2021-02-06 05:20:36', '0000-00-00 00:00:00', 1, 'mod_easyfileuploader', 2, 1, '{\"efu_parent\":\"images\",\"efu_folder\":\"documentos\",\"efu_maxsize\":\"471859200\",\"efu_custom\":\"1\",\"efu_label\":\"Seleccione el archivo a cargar:\",\"efu_button\":\"Cargar\",\"efu_question\":\"\\u00bfReemplazar los archivos existentes con los que archivos a cargar?\",\"efu_yes\":\"Si\",\"efu_no\":\"No\",\"efu_filetypes\":\"application\\/pdf;application\\/msword;application\\/vnd.openxmlformats-officedocument.wordprocessingdml.document;application\\/vnd.ms-excel;application\\/vnd.openxmlformats-officedocument.spreadsheetml.sheet;application\\/vnd.ms-powerpoint;application;vnd.openxmlformats-officedocument.presentationml.slideshow;application\\/bnd.ms-powerpoint;application\\/vnd.openxmlformats-officedocument.presentationml.presentation;application\\/vnd.openxmlformats-officedocument.presentationml.slideshow;application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"efu_default_replace\":\"0\",\"efu_replace\":\"0\",\"efu_scriptsinarchives\":\"0\",\"efu_variable\":\"fileToUpload\",\"efu_multiple\":\"1\",\"efu_shownofile\":\"0\",\"efu_user\":\"0\",\"moduleclass_sfx\":\"\",\"layout\":\"_:default\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(95, 89, 'Menú del Repositorio', '', NULL, 1, 'offcanvas', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_menu', 1, 1, '{\"menutype\":\"mainmenu\",\"base\":\"\",\"startLevel\":1,\"endLevel\":0,\"showAllChildren\":1,\"tag_id\":\"\",\"class_sfx\":\"\",\"window_open\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"itemid\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(96, 125, 'InformacionNeo', '', '<h2>Neuropsicología</h2>\r\n<p><img src=\"images/fotos/cerebro.jpg\" width=\"500\" height=\"400\" /></p>\r\n<p>La Neuropsicología se basa en principio realizar un diagnóstico preciso de las alteraciones de las funciones superiores afectadas: habla, lenguaje, memoria, atención, mediante una entrevista inicial con el paciente. </p>', 1, 'position5', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(97, 126, 'InformacionNeo2', '', '<h2>Psicología</h2>\r\n<p><br />La definición de psicología nace de la palabra psique, cuyo significado es espíritu/alma y logos, que significa tratado o estudio. Ambas palabras conjugadas hacen referencia al estudio del alma y el espíritu, sin embargo, con el paso del tiempo, la comunidad científica fue realizando diferentes investigaciones y llegaron a la conclusión que la psicología no podía simplemente estudiar algo no es aceptado por muchos, que va más allá de algo etéreo como el espíritu y que debe tomarse como una ciencia, por lo que hacer la pregunta sobre qué es la psicología abarca más lo esperado.</p>', 1, 'position6', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(98, 127, 'Fotos', '', '<h3 style=\"text-align: center;\">Imagenes</h3>\r\n<p><img src=\"images/Navegacion/fotos.png\" width=\"800\" height=\"500\" /></p>\r\n<p>Este módulo cuenta con características de subida de imágenes con la posibilidad de dar una descripción a la misma, con el fin de ser una información más didáctica y fácil de digerir.</p>', 1, 'position1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(99, 128, 'videos', '', '<h3 style=\"text-align: center;\">Videos</h3>\r\n<p><img src=\"images/Navegacion/videos.png\" width=\"800\" height=\"500\" /></p>\r\n<p>Este módulo permite la transmisión de información por medio de videos que contiene una gran información acerca de diversos temas relacionados con la materia.</p>', 1, 'position2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(100, 129, 'podcast', '', '<h3 style=\"text-align: center;\">Podcast</h3>\r\n<p><img src=\"images/Navegacion/podcast.png\" width=\"800\" height=\"500\" /></p>\r\n<p>Este modulo permite escuchar por medio de su reproductor un podcast con información relevante de la materia, dando un sistema mas flexible de información a los estudiantes.</p>', 1, 'position3', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(101, 130, 'Documentos', '', '<h3 style=\"text-align: center;\">Documentos</h3>\r\n<p><img src=\"images/Navegacion/model3D.png\" width=\"800\" height=\"500\" /></p>\r\n<p>Informacion</p>', 1, 'position4', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(102, 131, 'antecedentes', '', '<h4> Antecedentes</h4>\r\n<p><br />Otras La neuropsicología: historia, conceptos básicos y aplicaciones. <br />Programa de especialidades y maestrías <br />Avances en Psicología Latinoamericana <br />Historia de la neuropsicología en la facultad de psicología en la universidad de san buenaventura seccional medellin</p>', 1, 'bottom1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(103, 132, 'otrasmaterias', '', '<h4>Materias</h4>\r\n<ul>\r\n<li>\r\n<p>Ingeniería en sistema</p>\r\n</li>\r\n<li>\r\n<p>Medicina</p>\r\n</li>\r\n<li>\r\n<p>Psicología</p>\r\n<p>  </p>\r\n</li>\r\n</ul>', 1, 'bottom2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(104, 133, 'InformacionADC', '', '<h4>Informacion adicional</h4>\r\n<p>Para más información de proyecto se puede leer en el área de proyecto donde puedes encontrar todo lo relacionado con este proyecto.</p>', 1, 'bottom3', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(105, 134, 'Foto de inicio', '', '<p><img src=\"images/fotos/cerebro_plasma.jpg\" width=\"1889\" height=\"1080\" /></p>', 1, 'left', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(106, 135, 'Equipo', '', '<h2>Equipo de trabajo</h2>\r\n<p>Nuestro equipo de trabajo se compone de los siguientes integrantes</p>\r\n<p><img src=\"images/personal/personal.jpeg\" width=\"400\" height=\"250\" /></p>\r\n<p>Mi nombre es Jorge Efrén Flores Ordóñez, soy estudiante de la Universidad Técnica Particular de Loja y soy miembro del grupo de desarrolladores a cargo del repositorio digital de Neuropsicología y Psicofisiología, actualmente estoy cursando el quinto ciclo de la carrera de Ingeniería en Ciencias de la Computación. Este respositorio fue un logro alcanzado con nada más que trabajo en equipo.</p>\r\n<p><img src=\"images/personal/personal2.jpg\" width=\"400\" height=\"250\" /></p>\r\n<p>Luis Fernando Quizhpe Espinosa, nacido en Loja el 26 de Abril de 1998. Sus estudios secundarios los realizó Instituto Superior Tecnológico \"Daniel Álvarez Burneo\" y cursa sus estudios superiores en la carrera de Ingeniería en Ciencias de la Computación en la Universidad Técnica Particular de Loja. Es miembro del grupo de desarrolladores a cargo del repositorio digital de Neuropsicología y Psicofisiología.</p>\r\n<p><img src=\"images/personal/personal3.jpg\" width=\"400\" height=\"250\" /></p>\r\n<p>Daniel Marcelo Medina Ojeda, nacido en Zamora el 1 de diciembre de 1998. Sus estudios secundarios los realizó Instituto Superior “San francisco de Asis” y cursa sus estudios superiores en la carrera de Ingeniería en Ciencias de la Computación en la Universidad Técnica Particular de Loja. Es miembro del grupo de desarrolladores a cargo del repositorio digital de Neuropsicología y Psicofisiología.</p>', 1, 'left', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(107, 136, 'proyecto', '', '<h2>Proyectos</h2>\r\n<p style=\"text-align: center;\"><img src=\"images/repositorio.png\" alt=\"\" width=\"1327\" height=\"635\" /></p>\r\n<p>Nuestro proyecto nace de la necesidad de buscar información, siempre  a realizar una investigación tenemos los típicos problemas de información dispersa por múltiples paginas de la red, entonces se pensó en recoger todo tipo de información de la misma universidad y otras fuentes bajo el mismo techo creando un entorno donde podemos encontrar diferentes tipos de información ya sea visual, auditiva o audiovisual, al poner todas estas características bajo el mismo sistemas los tiempos de búsqueda y investigación mejoran drásticamente pues la misma requiere de menos trabajo para encontrar los datos necesitada, por ello se nos dio a relazar este sistema tipo repositorio donde desde docentes y estudiantes puedes retroalimenta su conocimiento, por medio de aportes previamente validados por los mismo docentes, obtenemos un ambiente optimo para ser auto didactas y buscas lo que tanto necesitamos para que nuestra investigación las respuestas sea satisfactorias.</p>\r\n<p>El uso de un repositorio es esencial puesto a que nos repite tener un gran número de información de una materia en particular y sus distintas áreas del mismo, con ello tenemos cubierto una gran cantidad de datos que podemos prever al usuario.</p>', 1, 'left', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(108, 137, 'Repositorio', '', '<h2>Instrucciones del Repositorio</h2>\r\n<p> Bienvenido a nuestro repositorio, este repositorio tiene le objetivo de albergar todo tipo de información de las materias Neuropsicología y Psicofisiología.</p>\r\n<p>Instrucciones de uso:</p>\r\n<p>En el panel acceder podemos registrarnos de la siguiente manera.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/Registro.png\" alt=\"\" /></p>\r\n<p>A demás de poder personalizar nuestro perfil.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/Editarperfil.png\" alt=\"\" /></p>\r\n<p> </p>\r\n<p>Una vez finalizado el registro podemos acceder observar el siguiente cambio en nuestra barra de navegación.</p>\r\n<p> <img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/MenuEditor.png\" alt=\"\" /></p>\r\n<p>Al igual que posibilidad de acceder  los siguientes módulos como Imágenes, Videos, Podcast.</p>\r\n<p style=\"text-align: center;\"><img src=\"images/imagenes/MenuDesplegable.png\" alt=\"\" /></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p>Podemos acceder a la subida de archivos posicionando el cursor encima del módulo en cuestión, por motivos didácticos vamos a usar el módulo fotos</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/subir archivos.png\" alt=\"\" /></p>\r\n<p>En cada módulo fotos podemos realizar subida de archivos de la siguiente forma:</p>\r\n<p>Podemos poner un titulo.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/titulomodulo.png\" alt=\"\" /></p>\r\n<p> </p>\r\n<p>Y una descripción a nuestra imagen</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/imagenes/Modulotexto.png\" alt=\"\" /></p>\r\n<p>Por ultimo se guardamos y se publicara nuestro aporte.</p>\r\n<p style=\"text-align: left;\"> </p>', 1, 'left', 0, '0000-00-00 00:00:00', '2021-02-07 07:58:18', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(109, 159, 'Intruccionesdecargadocs', '', '<h3>Instrucciones de uso.</h3>\r\n<p>Para realizar un carga de archivo de este modulo se necesita realizar los siguiente:<br />Reemplace la cadena \"document_url\" con la URL del documento que desea ver.</p>\r\n<p>{google_docs}http://www.example.com/docs/document.pdf{/google_docs}</p>', 1, 'position7', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(110, 160, 'Intruccionesdecargavideos', '', '<h3>Instrucciones de uso.</h3>\r\n<p>Para realizar la subida de un video por medio de una url se puede usar las siguientes etiquetas de complemento simples como:</p>\r\n<p>{youtube} https://www.youtube.com/watch?v=0u_g6zNuP_I {/ youtube} o simplemente {youtube} 0u_g6zNuP_I {/ youtube}</p>', 1, 'position7', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(111, 161, 'Intruccionesdecargapodcast', '', '<h3>Instrucciones de uso.</h3>\r\n<p>Para realizar la subida de un video por medio de una url se puede usar las siguientes etiquetas de complemento simples como:</p>\r\n<p>{mp3} pixies_bonemachine {/ mp3}</p>', 1, 'position7', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(112, 179, 'adminBoton', '', '<p><a href=\"administrator/index.php\">Administración</a></p>', 1, 'left', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 2, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*');
