(26, 'com_content.article', 'La Caja Torácica', 'caja-toracica', '<div class=\"article-header\">\r\n<h3><img src=\"images/imagenes/cajatorasica.jpeg\" alt=\"\" /></h3>\r\n</div>\r\n<div class=\"article-introtext\">\r\n<p><img src=\"images/caja_toraxicajpg.jpg\" alt=\"\" />El tórax es la parte del cuerpo humano que está entre la base del cuello y el diafragma. Contiene a los pulmones, el corazón, voluminosos vasos sanguíneos, linfáticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simpática de donde salen las ramas esplácnicas, las venas ácigos (mayor y menor), el esófago y el conducto torácico. Su división fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.</p>\r\n<p>Tiene forma de cono truncado o pirámide y su pared está formada por los arcos costales (costillas) y los músculos intercostales, que se unen anteriormente al hueso esternón por medio de cartílagos y posteriormente a la columna vertebral. La función de esta formación osteocartilaginosa, es la de proteger los órganos internos de los traumatismos mecánicos, que de otra manera podrían lesionarlos.</p>\r\n<p>La caja torácica tiene la particularidad de ser expansible, permitiendo la inspiración (inhalación). Además, su último par de costillas son flotantes, ya que están unidas solo a las vértebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.</p>\r\n<p>El nombre deriva del Latín thorax, y este del griego -θώραξ-; que significa propiamente coraza.</p>\r\n</div>', 1, '0000-00-00 00:00:00', 0, 1, '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"helix_ultimate_image\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\"}', 0, '{}', 380, '', '2021-02-08 09:47:21', 380, '2021-02-08 09:55:35', '*', '2021-02-08 09:47:21', '0000-00-00 00:00:00', 30, 164, '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', 0, 3, 1, '', '', 19, '', 1),
(27, 'com_content.article', 'Partes del cráneo', 'partes-del-craneo-2', '<h2><img src=\"images/imagenes/creaneo.jpeg\" alt=\"\" /></h2>\r\n<p> El cráneo es el esqueleto de la cabeza y diversos huesos constituyen sus dos partes: el neurocráneo y esplacnocráneo. El neurocráneo es la caja ósea del encéfalo y sus cubiertas membranosas. En un adulto, está formado por una serie de ocho huesos: cuatro impares centrados en la línea media (frontal, etmoides, esfenoides y occipital) y dos series de pares bilaterales (temporal y parietal). Los huesos del denominado neurocráneo en conjunto conforman otras dos estructuras anatómicas: Los huesos frontal, parietales y occipital suelen conformar una estructura de techo parecido a una cúpula, denominada calvaria o bóveda craneal, mientras que el hueso esfenoides y temporales forman parte de la base del cráneo.</p>\r\n<p>El esplacnocráneo o viscerocráneo, también llamado esqueleto facial, constituye la parte anterior del cráneo y se compone de los huesos que rodean la boca (maxilares y mandíbula), la nariz/cavidad nasal y la mayor parte de las cavidades orbitarias. Este consta de 14 huesos irregulares: dos huesos impares centrados (mandíbula y vómer) y seis huesos pares bilaterales (maxilar, cornete nasal inferior, cigomático, palatino, nasal y lagrimal). Los maxilares y la mandíbula albergan los dientes; dicho de otra manera, proporcionan las cavidades y el hueso de sostén para los dientes maxilares y mandibulares. Los maxilares forman la mayor parte del esqueleto facial superior, fijado a la base del cráneo. La mandíbula forma el esqueleto facial inferior, siendo este de carácter móvil al articularse con la base del cráneo en las articulaciones temporomandibulares.</p>', 1, '0000-00-00 00:00:00', 0, 1, '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"helix_ultimate_image\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\"}', 0, '{}', 380, '', '2021-02-08 09:54:47', 380, '2021-02-08 09:56:17', '*', '2021-02-08 09:54:47', '0000-00-00 00:00:00', 31, 166, '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', 0, 3, 0, '', '', 19, '', 1),
