\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":14,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(135, 29, 1, '', '2021-02-08 09:44:46', 380, 2277, '991d1d1fe71dc933ca1bf67245a38a03956b27a2', '{\"id\":29,\"asset_id\":162,\"title\":\"Caja Toracica\",\"alias\":\"caja-toracica\",\"introtext\":\"<h3>Caja Tor\\u00e1cica<\\/h3>\\r\\n<p><img src=\\\"images\\/imagenes\\/cajatorasica.jpeg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>El t\\u00f3rax es la parte del cuerpo humano que est\\u00e1 entre la base del cuello y el diafragma. Contiene a los pulmones, el coraz\\u00f3n, voluminosos vasos sangu\\u00edneos, linf\\u00e1ticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simp\\u00e1tica de donde salen las ramas espl\\u00e1cnicas, las venas \\u00e1cigos (mayor y menor), el es\\u00f3fago y el conducto tor\\u00e1cico. Su divisi\\u00f3n fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.<\\/p>\\r\\n<p>Tiene forma de cono truncado o pir\\u00e1mide y su pared est\\u00e1 formada por los arcos costales (costillas) y los m\\u00fasculos intercostales, que se unen anteriormente al hueso estern\\u00f3n por medio de cart\\u00edlagos y posteriormente a la columna vertebral. La funci\\u00f3n de esta formaci\\u00f3n osteocartilaginosa, es la de proteger los \\u00f3rganos internos de los traumatismos mec\\u00e1nicos, que de otra manera podr\\u00edan lesionarlos.<\\/p>\\r\\n<p>La caja tor\\u00e1cica tiene la particularidad de ser expansible, permitiendo la inspiraci\\u00f3n (inhalaci\\u00f3n). Adem\\u00e1s, su \\u00faltimo par de costillas son flotantes, ya que est\\u00e1n unidas solo a las v\\u00e9rtebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.<\\/p>\\r\\n<p>El nombre deriva del Lat\\u00edn thorax, y este del griego -\\u03b8\\u03ce\\u03c1\\u03b1\\u03be-; que significa propiamente coraza.<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":\"2\",\"created\":\"2021-02-08 09:44:46\",\"created_by\":\"380\",\"created_by_alias\":null,\"modified\":\"2021-02-08 09:44:46\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2021-02-08 09:44:46\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{}\",\"urls\":\"{}\",\"attribs\":\"{\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":\"1\",\"hits\":null,\"metadata\":\"{}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":null,\"note\":null}', 0),
(136, 30, 1, '', '2021-02-08 09:47:21', 380, 2520, '20256efea14d07ba70f36d7411f07e1703830720', '{\"id\":30,\"asset_id\":163,\"title\":\"Caja Toracica\",\"alias\":\"caja-toracica\",\"introtext\":\"<div class=\\\"article-header\\\">\\r\\n<h3><a href=\\\"index.php\\/repositorio\\/fotos\\/19-articulos-con-fotos\\/24-la-caja-toracica\\\">La Caja Tor\\u00e1cica<\\/a><\\/h3>\\r\\n<p><img src=\\\"images\\/imagenes\\/cajatorasica.jpeg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"article-introtext\\\">\\r\\n<p><img src=\\\"images\\/caja_toraxicajpg.jpg\\\" alt=\\\"\\\" \\/>El t\\u00f3rax es la parte del cuerpo humano que est\\u00e1 entre la base del cuello y el diafragma. Contiene a los pulmones, el coraz\\u00f3n, voluminosos vasos sangu\\u00edneos, linf\\u00e1ticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simp\\u00e1tica de donde salen las ramas espl\\u00e1cnicas, las venas \\u00e1cigos (mayor y menor), el es\\u00f3fago y el conducto tor\\u00e1cico. Su divisi\\u00f3n fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.<\\/p>\\r\\n<p>Tiene forma de cono truncado o pir\\u00e1mide y su pared est\\u00e1 formada por los arcos costales (costillas) y los m\\u00fasculos intercostales, que se unen anteriormente al hueso estern\\u00f3n por medio de cart\\u00edlagos y posteriormente a la columna vertebral. La funci\\u00f3n de esta formaci\\u00f3n osteocartilaginosa, es la de proteger los \\u00f3rganos internos de los traumatismos mec\\u00e1nicos, que de otra manera podr\\u00edan lesionarlos.<\\/p>\\r\\n<p>La caja tor\\u00e1cica tiene la particularidad de ser expansible, permitiendo la inspiraci\\u00f3n (inhalaci\\u00f3n). Adem\\u00e1s, su \\u00faltimo par de costillas son flotantes, ya que est\\u00e1n unidas solo a las v\\u00e9rtebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.<\\/p>\\r\\n<p>El nombre deriva del Lat\\u00edn thorax, y este del griego -\\u03b8\\u03ce\\u03c1\\u03b1\\u03be-; que significa propiamente coraza.<\\/p>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":\"19\",\"created\":\"2021-02-08 09:47:21\",\"created_by\":\"380\",\"created_by_alias\":null,\"modified\":\"2021-02-08 09:47:21\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2021-02-08 09:47:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{}\",\"urls\":\"{}\",\"attribs\":\"{\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":\"1\",\"hits\":null,\"metadata\":\"{}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":null,\"note\":null}', 0),
(137, 31, 1, '', '2021-02-08 09:54:47', 380, 2559, '23812f4b445fb740c51fdcaaf2f57a509d0553f6', '{\"id\":31,\"asset_id\":165,\"title\":\"Partes del cr\\u00e1neo\",\"alias\":\"partes-del-craneo-2\",\"introtext\":\"<h2><img src=\\\"images\\/imagenes\\/creaneo.jpeg\\\" alt=\\\"\\\" \\/><\\/h2>\\r\\n<h2>El cr\\u00e1neo es el esqueleto de la cabeza y diversos huesos constituyen sus dos partes: el neurocr\\u00e1neo y esplacnocr\\u00e1neo. El neurocr\\u00e1neo es la caja \\u00f3sea del enc\\u00e9falo y sus cubiertas membranosas. En un adulto, est\\u00e1 formado por una serie de ocho huesos: cuatro impares centrados en la l\\u00ednea media (frontal, etmoides, esfenoides y occipital) y dos series de pares bilaterales (temporal y parietal). Los huesos del denominado neurocr\\u00e1neo en conjunto conforman otras dos estructuras anat\\u00f3micas: Los huesos frontal, parietales y occipital suelen conformar una estructura de techo parecido a una c\\u00fapula, denominada calvaria o b\\u00f3veda craneal, mientras que el hueso esfenoides y temporales forman parte de la base del cr\\u00e1neo.<\\/h2>\\r\\n<p>El esplacnocr\\u00e1neo o viscerocr\\u00e1neo, tambi\\u00e9n llamado esqueleto facial, constituye la parte anterior del cr\\u00e1neo y se compone de los huesos que rodean la boca (maxilares y mand\\u00edbula), la nariz\\/cavidad nasal y la mayor parte de las cavidades orbitarias. Este consta de 14 huesos irregulares: dos huesos impares centrados (mand\\u00edbula y v\\u00f3mer) y seis huesos pares bilaterales (maxilar, cornete nasal inferior, cigom\\u00e1tico, palatino, nasal y lagrimal). Los maxilares y la mand\\u00edbula albergan los dientes; dicho de otra manera, proporcionan las cavidades y el hueso de sost\\u00e9n para los dientes maxilares y mandibulares. Los maxilares forman la mayor parte del esqueleto facial superior, fijado a la base del cr\\u00e1neo. La mand\\u00edbula forma el esqueleto facial inferior, siendo este de car\\u00e1cter m\\u00f3vil al articularse con la base del cr\\u00e1neo en las articulaciones temporomandibulares.<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":\"19\",\"created\":\"2021-02-08 09:54:47\",\"created_by\":\"380\",\"created_by_alias\":null,\"modified\":\"2021-02-08 09:54:47\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2021-02-08 09:54:47\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{}\",\"urls\":\"{}\",\"attribs\":\"{\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":\"1\",\"hits\":null,\"metadata\":\"{}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":null,\"note\":null}', 0),
(138, 30, 1, '', '2021-02-08 09:55:06', 380, 3669, 'fccbda0aa88d36fc8f60016ea03d26828ca9729e', '{\"id\":30,\"asset_id\":\"163\",\"title\":\"Caja Toracica\",\"alias\":\"caja-toracica\",\"introtext\":\"<div class=\\\"article-header\\\">\\r\\n<h3><a href=\\\"index.php\\/repositorio\\/fotos\\/19-articulos-con-fotos\\/24-la-caja-toracica\\\">La Caja Tor\\u00e1cica<\\/a><\\/h3>\\r\\n<p><img src=\\\"images\\/imagenes\\/cajatorasica.jpeg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"article-introtext\\\">\\r\\n<p><img src=\\\"images\\/caja_toraxicajpg.jpg\\\" alt=\\\"\\\" \\/>El t\\u00f3rax es la parte del cuerpo humano que est\\u00e1 entre la base del cuello y el diafragma. Contiene a los pulmones, el coraz\\u00f3n, voluminosos vasos sangu\\u00edneos, linf\\u00e1ticos y la arteria aorta (ascendente, arco y descendente), la vena cava inferior, la cadena ganglionar simp\\u00e1tica de donde salen las ramas espl\\u00e1cnicas, las venas \\u00e1cigos (mayor y menor), el es\\u00f3fago y el conducto tor\\u00e1cico. Su divisi\\u00f3n fundamentalmente consiste en el mediastino y las dos cavidades pulmonares.<\\/p>\\r\\n<p>Tiene forma de cono truncado o pir\\u00e1mide y su pared est\\u00e1 formada por los arcos costales (costillas) y los m\\u00fasculos intercostales, que se unen anteriormente al hueso estern\\u00f3n por medio de cart\\u00edlagos y posteriormente a la columna vertebral. La funci\\u00f3n de esta formaci\\u00f3n osteocartilaginosa, es la de proteger los \\u00f3rganos internos de los traumatismos mec\\u00e1nicos, que de otra manera podr\\u00edan lesionarlos.<\\/p>\\r\\n<p>La caja tor\\u00e1cica tiene la particularidad de ser expansible, permitiendo la inspiraci\\u00f3n (inhalaci\\u00f3n). Adem\\u00e1s, su \\u00faltimo par de costillas son flotantes, ya que est\\u00e1n unidas solo a las v\\u00e9rtebras, en la parte posterior, lo que permite su ensanchamiento en el embarazo.<\\/p>\\r\\n<p>El nombre deriva del Lat\\u00edn thorax, y este del griego -\\u03b8\\u03ce\\u03c1\\u03b1\\u03be-; que significa propiamente coraza.<\\/p>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"19\",\"created\":\"2021-02-08 09:47:21\",\"created_by\":\"380\",\"created_by_alias\":\"\",\"modified\":\"2021-02-08 09:55:06\",\"modified_by\":\"380\",\"checked_out\":\"380\",\"checked_out_time\":\"2021-02-08 09:51:06\",\"publish_up\":\"2021-02-08 09:47:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"1\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
